            "description": "Principal advisor to the Under Secretary of Defense (Policy) and the Secretary of Defense on national security strategy and defense strategy and in the requirements, forces and contingency plans necessary to implement those strategies. Civil functions of the Department of the Army include the Civil Works Program, the administration of Arlington and Soldiers' Home National Cemeteries, and other related matters.  The Army's Civil Works Program, a responsibility of the Corps of Engineers is the Nation's major Federal water resources development activity and involves engineering works such as major dams, reservoirs, levees, harbors, waterways, locks, and many other types of structures.  These works provide flood protection for cities and major river valleys, reduce the cost of transportation, supply water for municipal and industrial use, generate hydroelectric power, provide recreational opportunities for vast numbers of people, regulate the rivers for many purposes including the improvement of water quality and the enhancement of fish and wildlife, protect the shores of the oceans and lakes, and provide still other types of benefits.  Planning assistance is also provided to States and other nonfederal entities for the comprehensive management of water resources, including pollution abatement works.  In addition, through the Civil Works Program the Federal government protects the navigable waters of the United States under legislation empowering the Secretary of the Army to prohibit activities which would reduce the value of such waters to the Nation.  Includes two lead offices: the Office of Naval Research and the Office of Naval Technology. The Chief of Naval Research is responsible for the Department of Navy Research (6.1) and Exploratory Development (6.2) Programs.  The Chief of Naval Research is responsible to the Secretary of the Navy through the Assistant Secretary (Research, Engineering and Systems) and is a principal adviser to the latter.  The Chief of Naval Research is also responsible for providing leadership, management, and direction to the Department of Navy research and exploratory development programs and other research, development, technology, and equipment programs assigned to and conducted by the Office of the Chief of Naval Research; developing and formulating viable and responsive naval research and technology requirements based on current and projected Navy and Marine Corps long-range objectives and considerations of national security; and coordinating naval research and promoting cooperative research efforts within the Department of the Navy with other elements of the Department of Defense, National Science Foundation, National Aeronautics and Space Administration, Department of Energy, and other government research groups.  The Office of Naval Research also conducts research in conjunction with the research and development conducted by other Department of Navy activities, coordinates the Naval Basic Research Program, and conducts a contract management program with educational institutions in support of all Federal agencies.  The Office of Naval Technology, established in October 1980, manages the Department of Navy's Exploratory Development (6.2) Program, assessing, planning, programming, budgeting, directing, and monitoring the program, and manages the oversight activities in regard to the Industrial Independent Research and Development Program. The Secretary's responsibilities include matters pertaining to organization, training, logistical support, maintenance, welfare of personnel, administrative, recruiting, research and development, and other activities prescribed by the President or the Secretary of Defense.  The principal assistant to the Secretary is the Under Secretary, who acts with the full authority of the Secretary on all affairs of the Department.  The Air Force Materiel Command researches, develops, tests, acquires, delivers, and logistically supports every Air Force weapons system.  It has responsibilities from inception of a weapons system through its operational life and final disposition.  The Air Force Materiel Command operates major product centers, logistics centers, test centers, and laboratories.  It was created in July 1992 through the integration of the Air Force Logistics Command and the Air Force Systems Command. The Defense Advanced Research Projects Agency is a separately organized agency within the Department of Defense under a Director appointed by the Secretary of Defense.  The Agency engages in advanced, basic, and applied research and development projects essential to the Department of Defense, and conducts prototype projects that embody technology that may be incorporated into joint programs, programs in support of deployed U.S. forces, or selected Military Department programs and, on request, assists the Military Departments in their prototype efforts.  In this regard, the Agency arranges, manages, and directs the performance of work connected with assigned advanced projects by the Military Departments, other government agencies, individuals, private business entities, as appropriate; recommends through the Under Secretary of Defense for Acquisition to the Secretary of Defense assignment of advanced projects to the Agency; keeps the Under Secretary, the Organization of Joint Chiefs of Staff, the Military Departments, and other Department of Defense agencies informed on significant new developments and technological advances within assigned projects; and performs other such functions as the Secretary of Defense or the Under Secretary may assign.",
